// Import Styled
import styled from 'styled-components';

export const TitleH2 = styled.text`
	opacity: 0.9;
	color: #42505C;
    display: inline-block;
    h2{
		font-weight: 500;
		font-size: 18px;
		letter-spacing: 0.25px;
		line-height: 15px;
    }
`;
